//SPDX-License-Identifier: MIT
pragma solidity >=0.4.0 <0.9.0;
pragma experimental ABIEncoderV2;


contract Payments{   
    struct Transaction {
        uint  ID;
        uint value;
        address from;
        address to;
        uint    time;
        }
    uint transactionNumber;
    mapping(uint => Transaction) transactions;
    mapping(address => uint) balance;



    event Withdraw(Transaction t);
    event Deposit(Transaction t);
    event WithdrawFailure();
    event CurrentBalance(uint amount);

   /* constructor() public{

    }*/


    function deposit(uint amount) public payable{
        transactionNumber += 1;
        Transaction memory t = Transaction(
            transactionNumber,
            amount * 1 ether,
            msg.sender,
            address(this),
            block.timestamp
        );
        transactions[transactionNumber] = t;
        uint currentBalance = balance[msg.sender];
        balance[msg.sender] = currentBalance + msg.value;
        emit Deposit(t);
    }
    function withdraw(uint amount) public payable{
        if (balance[msg.sender] > amount){
            transactionNumber += 1;
            Transaction memory t = Transaction(
                transactionNumber,
                amount,
                address(this),
                msg.sender,
                block.timestamp
            );
            balance[msg.sender] -= amount;
            transactions[transactionNumber] = t;
            emit Withdraw(t);

        }else{
            emit WithdrawFailure();
        }

    }
    function getCurrentBalance() public {
        emit CurrentBalance(balance[msg.sender]);
    }




}
